import React, { useState, useEffect } from "react";

const Test = () => {
	const [state, setState] = useState(true);

	useEffect(() => {
		console.log(123);
		return () => {
			console.log("unmoutn");
		};
	}, []);

	return <button onClick>123</button>;
};

export default Test;
